import React from 'react';
import { Link } from 'react-router-dom';

import './Carousel.css'

const Carousel = ({ tags }) => {
    var buttons = [];
    console.log("length", tags.length);
    for (var i = 0; i < tags.length; i++) {
        console.log('hi')
        buttons.add(
            <div>
                <div>
                    {tags[i]}
                    Hi
                </div>
            </div>
        );
    };

    return(
        <div>
            {buttons}
            Hello
        </div>
    );
}

export default Carousel;
